import { useState } from "react";
import { View } from "react-native";
import { Text, TextInput, Button, RadioButton } from "react-native-paper";
import { styles } from "../../../assets/CSS/styles";

export function Cars(){
    const [state, setState] = useState("able");
return(
    <>
    <View style={styles.container}>
        <Text style={{ fontWeight:"bold", fontSize: 20, marginBottom: 20}}>Cars Register</Text>
        <View>
        <TextInput
          autoFocus
          label="plateNumber"
          left={<TextInput.Icon icon="account" />}
          onChangeText={''}
          value={'plateNumber'}
        />
        <TextInput
          style={{ marginTop: 10 }}
          autoFocus
          label="brand"
          left={<TextInput.Icon icon="account" />}
          onChangeText={(brand) => setBrand(brand)}
          value={brand}
        /> 
        <View style={{flexDirection:'row'}}>        
          <RadioButton          
          status={state === 'able' ? 'checked' : 'unchecked'}
          value='able'
          onPress={()=> setState('able')}
          />
          <Text style={{marginTop:10}}>Able</Text>          
        </View>
        <View style={{flexDirection:'row'}}>          
          <RadioButton
          status={state === 'disable' ? 'checked' : 'unchecked'}
          value='disable'
          onPress={()=> setState('disable')}/>
          <Text style={{marginTop:10}}>Disable</Text>
        </View>
        </View>
    </View>
    </>
)
}
